import logo_1 from './images/logo_1.jpg';
import { createTheme, alpha, getContrastRatio } from '@mui/material/styles';

const Footer = () => {

    var today = new Date();
    const pinkBase = "#fca5a5";
    const pinkMain = alpha(pinkBase, 0.7);

    const theme = createTheme({
        palette: {
            pink : {
                main : pinkMain,
                light: alpha(pinkBase, 0.5),
                dark: alpha(pinkBase, 0.9), 
                contrastText : getContrastRatio(pinkMain, '#fff') > 4.5 ? '#fff' : '#111',
            }
        }
    })

    return(
        <footer className=" bg-light p-0">
            <div className="container">

                <div className="d-flex justify-content-around">
                    <a href='/' className='navbar-brand mb-0 h1'>
                        <img src={logo_1} alt="Logo" width="40"/>
                        
                    </a>
                    <div className="d-flex flex-column">

                            <ul className="navbar-nav">
                                
                                <li className="nav-item">
                                    <a href="/" className="nav-link">
                                        Home
                                    </a>
                                </li>
                            
                                <li className="nav-item">
                                    <a href="/" className="nav-link">
                                        About
                                    </a>
                                </li>

                                <li className="nav-item">
                                    <a href="/" className="nav-link">
                                        Contact
                                    </a>
                                </li>
                            
                            </ul>

                    </div>
                </div>
                <div className="d-flex justify-content-center">
                    Copyright Â© {today.getFullYear()} NEXTBOOK 
                </div>
            </div>
        </footer>
    );
};

export default Footer;
